import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import Layout from '../../components/Layout/Layout';


class App extends Component {
	render() {
		return (
			<Layout>
				<h1>Rick & Morty</h1>
				<p>hey</p>
				<iframe src="https://giphy.com/embed/3oEduHUtBvTIIBosJq" width="480" height="270" frameBorder="0" class="giphy-embed" allowFullScreen></iframe><p><a href="https://giphy.com/gifs/rickandmorty-rick-and-morty-adult-swim02x04-3oEduHUtBvTIIBosJq"></a></p>
			</Layout>
		);
	}
}

export default App;
